import React, { Component } from 'react';
import {
   Button,
   Card,
   Classes,
   Elevation,
   H5,
   Label,
   Slider,
   Switch
} from '@blueprintjs/core';

export default class BluePrintView extends Component {
   render() {
      return (
         <div>
            <Card>
               <H5>
                  <a href='#'>Analytical applications</a>
               </H5>
               <p>
                  User interfaces that enable people to interact smoothly with
                  data, ask better questions, and make better decisions.
               </p>
               <Button text='Explore products' className={Classes.BUTTON} />
            </Card>
         </div>
      );
   }
}
